import React from "react";
import Dropdown from "bootstrap/js/dist/dropdown";
interface IProps {}


let DropDownList:React.FC<IProps> =() =>{

    return(
        <React.Fragment>
            <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
                <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#main_nav">
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse" id="main_nav">

                    <ul className="navbar-nav">
                        <li className="nav-item px-2 dropdown">
                            <a href="#" className="nav-link" data-toggle="dropdown">
                                <i className="fa fa-laptop"></i> Courses <i className="fa fa-caret-down"></i></a>
                            <div className="dropdown-menu p-2">
                                <a href="#" className="dropdown-item">HTML</a>
                                <a href="#" className="dropdown-item">CSS</a>
                                <a href="#" className="dropdown-item">JavaScript</a>
                                <a href="#" className="dropdown-item">Bootstrap</a>
                            </div>
                        </li>
                    </ul>

                </div>


            </nav>
        </React.Fragment>
    )
};
export default DropDownList;
